                "features": "<p><span style=\"color:#e67e22\"><strong>Guaranteed Discount</strong></span></p>\r\n\r\n<ul>\r\n\t<li>Origin will offer 17% off Origin Electricity usage and supply charges. This is currently 17% less than the reference price on Origin Max Saver for 12 months.</li>\r\n</ul>\r\n\r\n<p><span style=\"color:#e67e22\"><strong>Charges</strong></span></p>\r\n\r\n<ul>\r\n\t<li>\r\n\t<p>Charges depend on the usage or meter type at your property. Origin will confirm these once they&rsquo;ve identified your meter type and processed your application. You can also find this information on your bill.&rdquo;</p>\r\n\t</li>\r\n\t<li>\r\n\t<p>Additional charges that may apply are set out <a href=\"https://www.originenergy.com.au/for-home/electricity-and-gas/pricing/additional-charges.html\">here</a></p>\r\n\t</li>\r\n</ul>\r\n\r\n<p><span style=\"color:#e67e22\"><strong>Online account management</strong></span></p>\r\n\r\n<p>My Account from Origin is the easy way to manage your energy account online. It also allows you to monitor your energy usage.</p>",
