                    "eic": "<p style=\"margin-left:0cm; margin-right:0cm\"><span style=\"font-size:12px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">You understand and agree that:</span></span></p>\r\n\r\n<ul>\r\n\t<li>\r\n\t<p>You have read the plan details.</p>\r\n\t</li>\r\n\t<li>\r\n\t<p>You confirm you are authorised to enter into this agreement. You may also be eligible for Basic Home plan. This is an ongoing plan with no discount or benefits and is equivalent to the Victorian Default offer/ Default Market Offer,</p>\r\n\t</li>\r\n\t<li>\r\n\t<p>Your service, for the address we&rsquo;ve discussed, will be transferred to EnergyAustralia, which can take up to 90 days. EnergyAustralia will let you know when this is done.</p>\r\n\t</li>\r\n\t<li>\r\n\t<p>Move In (New Connection) -&nbsp;You confirm you are authorised to enter into this agreement and will be in contract with EnergyAustralia from today, for the service address we&rsquo;ve discussed.</p>\r\n\t</li>\r\n\t<li>\r\n\t<p>Depending on the meter type at your premises, EnergyAustralia&rsquo;s may vary your rates, terms and conditions to match the meter type. Please ensure you provide clear and unhindered access to the meter to ensure it&rsquo;s able to be read by your meter services provider. You&rsquo;ll be notified of changes to your terms or charges in writing; however your discount percentage won&rsquo;t change during your benefit period. If you&#39;ve chosen a plan with discounts; you may also be eligible for our standard product with no discounts.</p>\r\n\t</li>\r\n\t<li>\r\n\t<p>You should receive a Welcome Pack within 5 business days which will contain an outline of your payment options, all terms and conditions, fees, charges and current GST inclusive rates which may be varied at any time. Your welcome pack, bills and other correspondence will be delivered to you via email unless you have specified to receive it via standard mail. A late payment fee of up to $12 may be applied if the bill is not paid on time.</p>\r\n\t</li>\r\n\t<li>\r\n\t<p>Your 10-business day cooling off period commences the day after you receive your welcome pack. You may cancel your contract within the cooling off period without penalty by filling out the cancellation form in your Welcome Pack, or by calling EnergyAustralia directly. After the cooling off period, you can end your contract anytime in the ways set out in your contract.</p>\r\n\t</li>\r\n\t<li>\r\n\t<p>EnergyAustralia values your privacy. You can find their <a href=\"https://www.energyaustralia.com.au/privacy\" target=\"_blank\">Privacy Policy</a> and credit information statement at energyaustralia.com.au. It explains how they use and disclose your personal and credit information, your rights to access any information they hold and the credit reporting bodies that they exchange information with.</p>\r\n\t</li>\r\n\t<li>\r\n\t<p>You agree to be billed monthly if our metering service provider sends us monthly meter reads. If we don&#39;t receive monthly reads, we will issue your bill at least once every 3 months for both electricity and gas.</p>\r\n\t</li>\r\n\t<li>\r\n\t<p>EnergyAustralia may contact you in future to obtain your feedback or ask about the quality of the sales process.</p>\r\n\t</li>\r\n\t<li>\r\n\t<p>A credit check will be performed before switching you to EnergyAustralia. A letter will be sent to you if there are any issues. EnergyAustralia may also verify your ID details with the document issuer or official record holder.</p>\r\n\t</li>\r\n\t<li>\r\n\t<p><span style=\"font-size:12px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">You can pay&nbsp;your bills via any of the <a href=\"https://www.energyaustralia.com.au/home/bills-and-accounts/pay-your-bill/payment-options\" target=\"_blank\">payment options</a>. <a href=\"https://www.energyaustralia.com.au/conditions-pricing\" target=\"_blank\">Additional fees and charges</a> may apply.&nbsp;</span></span>If you would like to discuss your payment options or other available assistance you may be eligible for, please contact EnergyAustralia once you receive your welcome pack or first bill.</p>\r\n\t</li>\r\n\t<li>\r\n\t<p><span style=\"font-size:12px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">If your life support or concession needs changes, you must let EnergyAustralia know.</span></span></p>\r\n\t</li>\r\n\t<li>\r\n\t<p><span style=\"font-size:12px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">Our company has a relationship with EnergyAustralia of Level 33, 385 Bourke St Melbourne Victoria 3000. Our business receives a commission from EnergyAustralia when you enter into this agreement. EnergyAustralia can be contacted on 133 466 or by emailing ENQ@energyaustralia.com.au</span></span></p>\r\n\t</li>\r\n</ul>\r\n\r\n<p style=\"margin-left:0cm; margin-right:0cm; text-align:center\"><span style=\"color:null\"><span style=\"font-size:14px\"><span style=\"font-family:Arial,Helvetica,sans-serif\"><strong>You&#39;ll love this plan, we&#39;re sure of it.</strong></span></span></span></p>\r\n\r\n<p style=\"margin-left:0cm; margin-right:0cm; text-align:center\"><span style=\"font-size:12px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">We know you&#39;ll be happy with your decision, however, if for any reason you&#39;re not, let EnergyAustralia know in the first 10 business days and their friendly customer service team will (at your option) cancel your contract without penalty or move you to a more suitable plan.</span></span></p>",
